Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '7', Groupe: '1', Rapport:"5", Titre: "Le schtroumpfissime", Description: "Le Grand Schtroumpf quitte le village des Schtroumpfs à la recherche de l'ingrédient qui lui manque pour terminer une potion. En son absence, les Schtroumpfs décident de voter pour élire un chef. Un Schtroumpf plus malin manipule les autres pour remporter l'élection. Une fois au pouvoir, il prend le titre de Schtroumpfissime et impose petit à petit sa dictature.", DateDebut: "12/12/2020", DateFin: "20/06/2021", DateRenduRapport: "25/06/2021",DateSoutenance: "5/02/2021",StatutD: 2, DateEvaluation: "30/03/2021")
Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '7', Groupe: '15', Rapport:"6", Titre: "L'oeuf et les Schtroumpfs", Description: "Alors que les Schtroumpfs décident de faire un grand gâteau pour une fête, le Grand Schtroumpf décide d'envoyer le Schtroumpf grognon et un autre Schtroumpf au poulailler pour rapporter un œuf", DateDebut: "12/12/2020", DateFin: "20/06/2021", DateRenduRapport: "25/06/2021", DateEvaluation: "30/03/2021")
Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '7', Groupe: '14', Rapport:"7", Titre: "Le Cosmoschtroumpfs", Description: "Un des Schtroumpfs rêve de partir vers les étoiles et de visiter d'autres planètes. Pour ce faire, il consulte le Grand Schtroumpf, qui lui propose une recette quasiment irréalisable", DateDebut: "12/12/2020", DateFin: "20/06/2021", DateRenduRapport: "25/06/2021", DateEvaluation: "30/03/2021")
Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '6', Groupe: '7', Rapport:"8", Titre: "L'apprenti Schtroumpf", Description: "Un Schtroumpf rêve de faire de la magie comme le Grand Schtroumpf, mais celui-ci l'estime trop jeune pour y parvenir, et les tentatives de l'Apprenti Schtroumpf pour accéder à son grimoire se soldent par un échec.", DateDebut: "12/12/2020", DateFin: "20/08/2020", DateRenduRapport: "25/06/2021",StatutD: 5, DateEvaluation: "30/03/2021")
Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '6', Groupe: '3', Rapport:"12", Titre: "Histoire de Schtroumpfs", Description: "Qui ne connaît les Schtroumpfs ? Ces gentils lutins bleus à gros bonnet blanc se ressemblent tous, même s'ils ont chacun leur caractère, et parlent une curieuse langue dans laquelle la plupart des mots sont remplacés par schtroumpf", DateDebut: "12/12/2020", DateFin: "2/06/2020", DateRenduRapport: "25/06/2021",StatutD: 5, DateEvaluation: "30/03/2021")
Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '6', Groupe: '4', Rapport:"13", Titre: "Les schtroumpfs olympiques", Description: "Le Schtroumpf Costaud décide d'organiser des jeux, et le vainqueur aura droit à un baiser de la Schtroumpfette", DateDebut: "12/12/2020", DateFin: "20/06/2021", DateRenduRapport: "25/06/2021", DateEvaluation: "30/03/2021")
Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '7', Groupe: '13', Rapport:"14", Titre: "Les p'tits Schtroumpfs", Description: "Lors d’une expérience, le Grand Schtroumpf casse son sablier et demande à trois Schtroumpfs (le Schtroumpf Nature, le Schtroumpf Molasson et le Schtroumpf Colérique) d’aller en chercher un autre chez le Père Temps.", DateDebut: "12/12/2020", DateFin: "20/06/2020", DateRenduRapport: "25/06/2021",StatutD: 5, DateEvaluation: "30/03/2021")
Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '6', Groupe: '11', Rapport:"15", Titre: "La menace Schtroumpf", Description: "Les Schtroumpfs se remettent à se disputer, à se battre et à entrer en discorde.", DateDebut: "12/12/2020", DateFin: "20/06/2021", DateRenduRapport: "25/06/2021", DateEvaluation: "30/03/2021")
Project.create(Projet: '4', EncadrantAca: '2', EncadrantInd: '7', Groupe: '12', Rapport:"9", Titre: "La grande Schtroumpfette", Description: "Une série de réflexions malheureuses et la Schtroumpfette se rend compte soudain que, si les Schtroumpfs l'adorent, ils ne la prennent pas du tout au sérieux.", DateDebut: "12/12/2020", DateFin: "20/06/2021", DateRenduRapport: "25/06/2021", DateEvaluation: "30/03/2021")


